const ReactGA = require("react-ga");

ReactGA.initialize("UA-201396640-1");

const logPageView = () => {
  ReactGA.set({ page: window.location.pathname });
  ReactGA.pageview(window.location.pathname);
}

module.exports = { logPageView }
